import {Component, Input, Output, EventEmitter} from '@angular/core';
import {FragranceResponse} from "../../../../services/models/fragrance-response";

@Component({
  selector: 'app-fragrance-card',
  templateUrl: './fragrance-card.component.html',
  styleUrl: './fragrance-card.component.scss'
})
export class FragranceCardComponent {
  private _manage = false;
  private _fragrancePhoto: string | undefined;
  private _fragrance: FragranceResponse = {};


  get fragrance(): FragranceResponse {
    return this._fragrance;
  }

  @Input()
  set fragrance(value: FragranceResponse) {
    this._fragrance = value;
  }

  get manage(): boolean {
    return this._manage;
  }

  @Input()
  set manage(value: boolean) {
    this._manage = value;
  }

  get fragrancePhoto(): string | undefined {
    if (this._fragrance.picture) {
      return 'data:image/jpg;base64,' + this._fragrance.picture
    }
    return 'data:image/jpeg;base64,';
  }

  @Output() private details: EventEmitter<FragranceResponse> = new EventEmitter<FragranceResponse>();
  @Output() private edit: EventEmitter<FragranceResponse> = new EventEmitter<FragranceResponse>();
  @Output() private delete: EventEmitter<FragranceResponse> = new EventEmitter<FragranceResponse>();
  @Output() private favourite: EventEmitter<FragranceResponse> = new EventEmitter<FragranceResponse>();

  onShowDetails() {
    this.details.emit(this._fragrance);
  }

  onFavourite() {
    this.favourite.emit(this._fragrance);
  }

  onEdit() {
    this.edit.emit(this._fragrance);
  }

  onDelete() {
    this.delete.emit(this._fragrance);
  }
}
